-- ----------------------------
--  Table structure for `yoyocmf_column`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_column`;
CREATE TABLE `yoyocmf_column` (
  `classid` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `bclassid` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '父栏目ID',
  `classname` varchar(50) NOT NULL DEFAULT '' COMMENT '栏目名称',
  `sonclass` text NOT NULL COMMENT '子栏目ID，多个以竖线隔开',
  `is_zt` tinyint(1) NOT NULL DEFAULT '0' COMMENT '预定义字段，暂时用不到，默认值0',
  `lencord` smallint(6) NOT NULL DEFAULT '0' COMMENT '每页显示信息数',
  `link_num` tinyint(4) NOT NULL DEFAULT '0' COMMENT '相关链接数',
  `onclick` int(11) NOT NULL DEFAULT '0',
  `featherclass` text NOT NULL COMMENT '父栏目ID集合',
  `islast` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否终极栏目',
  `classpath` text NOT NULL COMMENT '栏目存放目录',
  `classtype` varchar(10) NOT NULL DEFAULT '' COMMENT '栏目文件扩展名',
  `newspath` varchar(20) NOT NULL DEFAULT '' COMMENT '内容页日期目录形式',
  `filename` tinyint(1) NOT NULL DEFAULT '0' COMMENT '内容页文件命名形式',
  `filetype` varchar(10) NOT NULL DEFAULT '' COMMENT '内容页文件扩展名',
  `openpl` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开启评论，0为开启，1为关闭',
  `openadd` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开放投稿，0为开启，1为关闭',
  `newline` int(11) NOT NULL DEFAULT '0' COMMENT '最新信息JS显示数',
  `hotline` int(11) NOT NULL DEFAULT '0' COMMENT '热门信息JS显示数',
  `goodline` int(11) NOT NULL DEFAULT '0' COMMENT '推荐信息JS显示数',
  `classurl` varchar(200) NOT NULL DEFAULT '' COMMENT '栏目绑定域名',
  `groupid` smallint(6) NOT NULL DEFAULT '0' COMMENT '默认内容页查看权限',
  `myorder` smallint(6) NOT NULL DEFAULT '0' COMMENT '排序',
  `filename_qz` varchar(20) NOT NULL DEFAULT '' COMMENT '内容文件名前缀',
  `hotplline` tinyint(4) NOT NULL DEFAULT '0' COMMENT '热门评论信息显示数',
  `checked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '信息默认是否审核，1为直接审核，0为未审核',
  `firstline` tinyint(4) NOT NULL DEFAULT '0' COMMENT '头条信息显示数',
  `bname` varchar(50) NOT NULL DEFAULT '' COMMENT '栏目别名',
  `tid` smallint(6) NOT NULL DEFAULT '0' COMMENT '数据表ID',
  `tbname` varchar(60) NOT NULL DEFAULT '' COMMENT '数据表名',
  `maxnum` int(11) NOT NULL DEFAULT '0' COMMENT '显示总记录数',
  `checkpl` tinyint(1) NOT NULL DEFAULT '0' COMMENT '评论是否需要审核，1为要审核，0为直接通过',
  `down_num` tinyint(4) NOT NULL DEFAULT '0' COMMENT '每行下载地址数',
  `online_num` tinyint(4) NOT NULL DEFAULT '0' COMMENT '每行在线观看地址数',
  `listorder` varchar(50) NOT NULL DEFAULT '' COMMENT '管理信息排序方式，默认：id DESC',
  `reorder` varchar(50) NOT NULL DEFAULT '' COMMENT '列表式页面排序方式，默认：newstime DESC',
  `intro` text NOT NULL COMMENT '栏目简介',
  `classimg` varchar(255) NOT NULL DEFAULT '' COMMENT '栏目缩略图',
  `addinfofen` int(11) NOT NULL DEFAULT '0' COMMENT '前台投稿加点数',
  `listdt` tinyint(1) NOT NULL DEFAULT '0' COMMENT '列表模式，0为静态列表，1为动态列表',
  `showclass` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示到导航，0为显示，1为不显示',
  `showdt` tinyint(1) NOT NULL DEFAULT '0' COMMENT '内容页模式，0为静态页面，1为动态生成，2为动态页面',
  `checkqadd` tinyint(1) NOT NULL DEFAULT '0' COMMENT '前台投稿是否要审核，0为要审核，1为直接通过',
  `qaddlist` tinyint(1) NOT NULL DEFAULT '0' COMMENT '投稿生成列表，0为不生成，1为生成当前栏目，2为生成首页，3为生成父栏目，4为生成当前栏目与父栏目，5为生成父栏目与首页，6为生成当前栏目、父栏目与首页',
  `qaddgroupid` text NOT NULL COMMENT '投稿权限，多个会员组ID用“,”半角逗号隔开，例如：,1,2,3,',
  `qaddshowkey` tinyint(1) NOT NULL DEFAULT '0' COMMENT '投稿是否开启验证码，1为开启，0为关闭',
  `adminqinfo` tinyint(1) NOT NULL DEFAULT '0' COMMENT '管理投稿，0为不能管理信息，1为可管理未审核信息，2为只可编辑未审核信息，3为只可删除未审核信息，4为可管理所有信息，5为只可编辑所有信息，6为只可删除所有信息',
  `doctime` smallint(6) NOT NULL DEFAULT '0' COMMENT '信息归档时间',
  `classpagekey` varchar(255) NOT NULL DEFAULT '' COMMENT '页面关键字',
  `nreclass` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否生成栏目页，0为生成，1为不生成',
  `nreinfo` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否生成内容页，0为生成，1为不生成',
  `nrejs` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否生成JS调用，0为生成，1为不生成',
  `addreinfo` tinyint(1) NOT NULL DEFAULT '0' COMMENT '发布信息生成内容页，1为生成，0为不生成 (后台)',
  `haddlist` tinyint(4) NOT NULL DEFAULT '0' COMMENT '发布生成列表，0为不生成，1为生成当前栏目，2为生成首页，3为生成父栏目，4为生成当前栏目与父栏目，5为生成父栏目与首页，6为生成当前栏目、父栏目与首页 (后台)',
  `sametitle` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否检测标题重复，0为不检测，1为检测',
  `definfovoteid` smallint(6) NOT NULL DEFAULT '0' COMMENT '信息预设投票ID',
  `wburl` varchar(255) NOT NULL DEFAULT '' COMMENT '外部栏目链接地址',
  `qeditchecked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '修改投稿是否需要审核，1为需要重新审核，0为不需要',
  `repreinfo` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否生成上一篇信息，1为生成，0为不生成',
  `cgroupid` text NOT NULL COMMENT '栏目页访问权限，多个会员组ID用“,”半角逗号隔开，例如：,1,2,3,',
  `cgtoinfo` tinyint(1) NOT NULL DEFAULT '0' COMMENT '栏目访问权限应用于信息，1为是，0为否',
  `bdinfoid` varchar(25) NOT NULL DEFAULT '' COMMENT '栏目绑定信息ID，格式：栏目ID,信息ID',
  `repagenum` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '生成列表静态页面数',
  `keycid` smallint(6) NOT NULL DEFAULT '0' COMMENT '替换内容关键字分类ID',
  `allinfos` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '栏目信息总数',
  `infos` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '审核通过的信息总数',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '增加栏目时间',
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`classid`),
  KEY `bclassid` (`bclassid`)
) ENGINE=MyISAM AUTO_INCREMENT=58 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `yoyocmf_config`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_config`;
CREATE TABLE `yoyocmf_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '配置名',
  `value` text COLLATE utf8_unicode_ci COMMENT '配置值',
  `extra` text COLLATE utf8_unicode_ci NOT NULL COMMENT '配置项',
  `description` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '配置描述',
  `type` varchar(30) COLLATE utf8_unicode_ci DEFAULT 'text' COMMENT '配置类型',
  `created_at` int(10) NOT NULL,
  `updated_at` int(10) NOT NULL,
  `group` varchar(30) COLLATE utf8_unicode_ci DEFAULT 'system' COMMENT '配置分组',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC;

