, '', '默认缩略图高', 'text', '1544887057', '1544887057', 'pic', '2'), ('33', 'spickill', '1', '1=>是\r\n0=>否', '超出部分是否截取', 'radio', '1544887120', '1544887144', 'pic', '3'), ('34', 'ifwater', '0', '0=>无需水印\r\n1=>开启', '是否需要水印', 'radio', '1544947918', '1544947918', 'pic', '4'), ('35', 'imagetype', '', '', '后台上传图片扩展名(多个请用“|”格开，如：.gif|.jpg)', 'text', '1544963577', '1544963577', 'file', '3'), ('36', 'sitelogo', 'http://yoyocmf.ccc/storage/upload/20181221/76febf7e66c1622dc1f352c030b3643f.png', '', '站点logo', 'image', '1544964760', '1545358382', 'base', '2');
