-- ----------------------------
--  Table structure for `yoyocmf_document`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_document`;
CREATE TABLE `yoyocmf_document` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `smalltext` char(255) DEFAULT NULL,
  `classid` int(11) DEFAULT '0' COMMENT '栏目ID',
  `ttid` int(11) DEFAULT '0' COMMENT '标题分类ID',
  `onclick` int(10) DEFAULT '0' COMMENT '点击数',
  `plnum` mediumint(8) DEFAULT '0' COMMENT '评论数',
  `totaldown` mediumint(8) DEFAULT '0' COMMENT '下载数',
  `newspath` char(20) DEFAULT '' COMMENT '存放日期目录',
  `filename` char(36) DEFAULT '' COMMENT '信息文件名(不含扩展名)',
  `user_id` int(11) DEFAULT '0' COMMENT '发布者用户ID',
  `username` char(20) DEFAULT '' COMMENT '发布者用户名',
  `firsttitle` tinyint(1) DEFAULT '0' COMMENT '是否头条(1为一级头条，0为普通信息)',
  `isgood` tinyint(1) DEFAULT '0' COMMENT '是否推荐(1为一级推荐，0为不推荐)',
  `ispic` tinyint(1) DEFAULT '0' COMMENT '是否标题图片(1为标题图片信息，0为普通信息)',
  `istop` tinyint(1) DEFAULT '0' COMMENT '置顶级别',
  `ismember` tinyint(1) DEFAULT '0' COMMENT '是否会员发布(1为前台会员发布，0为后台发布)',
  `isurl` tinyint(1) DEFAULT '0' COMMENT '是否外部链接(1为外部链接，0为普通信息)',
  `havehtml` tinyint(1) DEFAULT '0' COMMENT '是否生成过HTML标记(1为已生成，0为未生成)',
  `groupid` smallint(5) DEFAULT '0' COMMENT '允许查看的会员组ID',
  `userfen` smallint(5) DEFAULT '0' COMMENT '扣除点数',
  `titlefont` char(14) DEFAULT '' COMMENT '标题加色、加粗(格式：“#ff0000,b|i|s|”)',
  `titleurl` char(200) DEFAULT '' COMMENT '信息链接地址',
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
  `ftitle` char(120) DEFAULT '' COMMENT '副标题字段',
  `diggtop` int(11) DEFAULT '0' COMMENT 'DIGG字段',
  `stb` tinyint(3) DEFAULT '1' COMMENT '存放副表名',
  `title` char(100) DEFAULT '' COMMENT '标题字段',
  `titlepic` char(120) DEFAULT NULL COMMENT '标题图片字段',
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `classid` (`classid`),
  KEY `ttid` (`ttid`),
  KEY `firsttitle` (`firsttitle`),
  KEY `isgood` (`isgood`),
  KEY `ispic` (`ispic`),
  KEY `useridis` (`user_id`,`ismember`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

