-- ----------------------------
--  Table structure for `yoyocmf_document_data`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_document_data`;
CREATE TABLE `yoyocmf_document_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `classid` int(11) DEFAULT '0' COMMENT '栏目ID',
  `keyid` varchar(255) DEFAULT '' COMMENT '相关链接信息ID集合(多个信息ID用半角逗号“,”隔开)',
  `closepl` tinyint(1) DEFAULT '0' COMMENT '是否关闭评论(1为关闭评论，0为不关闭评论)',
  `infotags` varchar(80) DEFAULT '' COMMENT 'TAGS',
  `writer` varchar(30) DEFAULT '' COMMENT '作者',
  `befrom` varchar(60) DEFAULT '' COMMENT '信息来源信息',
  `newstext` mediumtext COMMENT '内容',
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `classid` (`classid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `yoyocmf_enewsclass`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_enewsclass`;
CREATE TABLE `yoyocmf_enewsclass` (
  `classid` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT '栏目ID',
  `bclassid` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '父栏目ID',
  `classname` varchar(50) NOT NULL DEFAULT '' COMMENT '栏目名称',
  `sonclass` text NOT NULL COMMENT '终极栏目ID集合(父栏目下所有终极栏目ID集合，多个栏目ID用“|”隔开，例如：|1|5|8|)',
  `is_zt` tinyint(1) NOT NULL DEFAULT '0' COMMENT '预定义字段，暂时用不到，默认值0',
  `lencord` smallint(6) NOT NULL DEFAULT '0' COMMENT '每页显示信息数',
  `link_num` tinyint(4) NOT NULL DEFAULT '0' COMMENT '相关链接数',
  `onclick` int(11) NOT NULL DEFAULT '0' COMMENT '点击数',
  `featherclass` text NOT NULL COMMENT '父栏目ID集合(所有上级父栏目ID集合，按层次存放，多个栏目ID用“|”隔开，例如：|1|2|3|)',
  `islast` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否终极栏目(1为终极栏目，0为非终极栏目)',
  `openpl` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开启评论(0为开启，1为关闭)',
  `openadd` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开放投稿(0为开启，1为关闭)',
  `newline` int(11) NOT NULL DEFAULT '0' COMMENT '最新信息JS显示数',
  `hotline` int(11) NOT NULL DEFAULT '0' COMMENT '热门信息JS显示数',
  `goodline` int(11) NOT NULL DEFAULT '0' COMMENT '推荐信息JS显示数',
  `hotplline` tinyint(4) NOT NULL DEFAULT '0' COMMENT '热门评论信息JS显示数',
  `firstline` tinyint(4) NOT NULL DEFAULT '0' COMMENT '头条信息JS显示数',
  `classurl` varchar(200) NOT NULL DEFAULT '' COMMENT '栏目绑定域名',
  `groupid` smallint(6) NOT NULL DEFAULT '0' COMMENT '默认内容页查看权限',
  `myorder` smallint(6) NOT NULL DEFAULT '0' COMMENT '排序',
  `checkpl` tinyint(1) NOT NULL DEFAULT '0' COMMENT '评论是否需要审核(1为要审核，0为直接通过)',
  `checked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '信息默认是否审核(1为直接审核，0为未审核)',
  `checkqadd` tinyint(1) NOT NULL DEFAULT '0' COMMENT '前台投稿是否要审核(0为要审核，1为直接通过)',
  `tbname` varchar(60) NOT NULL DEFAULT '' COMMENT '数据表名',
  `listorder` varchar(50) NOT NULL DEFAULT '' COMMENT '管理信息排序方式(默认：id DESC)',
  `reorder` varchar(50) NOT NULL DEFAULT '' COMMENT '列表式页面排序方式(默认：newstime DESC)',
  `bname` varchar(50) NOT NULL DEFAULT '' COMMENT '栏目别名',
  `intro` text NOT NULL COMMENT '栏目简介',
  `classpagekey` varchar(255) NOT NULL DEFAULT '' COMMENT '栏目关键字',
  `classimg` varchar(255) NOT NULL DEFAULT '' COMMENT '栏目缩略图',
  `addinfofen` int(11) NOT NULL DEFAULT '0' COMMENT '前台投稿加点数',
  `showclass` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示到导航(0为显示，1为不显示)',
  `qaddgroupid` text NOT NULL COMMENT '投稿权限(多个会员组ID用“,”半角逗号隔开，例如：,1,2,3,)',
  `qaddshowkey` tinyint(1) NOT NULL DEFAULT '0' COMMENT '投稿是否开启验证码(1为开启，0为关闭)',
  `adminqinfo` tinyint(1) NOT NULL DEFAULT '0' COMMENT '管理投稿(0为不能管理信息，1为可管理未审核信息，2为只可编辑未审核信息，3为只可删除未审核信息，4为可管理所有信息，5为只可编辑所有信息，6为只可删除所有信息)',
  `nrejs` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否生成JS调用(0为生成，1为不生成)',
  `sametitle` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否检测标题重复(0为不检测，1为检测)',
  `wburl` varchar(255) NOT NULL DEFAULT '' COMMENT '外部栏目链接地址',
  `qeditchecked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '修改投稿是否需要审核(1为需要重新审核，0为不需要)',
  `cgroupid` text NOT NULL COMMENT '栏目页访问权限(多个会员组ID用“,”半角逗号隔开，例如：,1,2,3,)',
  `cgtoinfo` tinyint(1) NOT NULL DEFAULT '0' COMMENT '栏目访问权限应用于信息(1为是，0为否)',
  `bdinfoid` varchar(25) NOT NULL DEFAULT '' COMMENT '栏目绑定信息ID(格式：栏目ID,信息ID)',
  `allinfos` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '栏目信息总数',
  `infos` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '审核通过的信息总数',
  `created_at` int(11) unsigned NOT NULL DEFAULT '0',
  `updated_at` int(11) NOT NULL,
  PRIMARY KEY (`classid`),
  KEY `bclassid` (`bclassid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `yoyocmf_enewsclassadd`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_enewsclassadd`;
CREATE TABLE `yoyocmf_enewsclassadd` (
  `classid` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '栏目ID',
  `ttids` text NOT NULL COMMENT '栏目选择标题分类ID(多个标题分类ID用“,”半角逗号隔开，例如：,1,2,3,)',
  `eclasspagetext` mediumtext NOT NULL,
  PRIMARY KEY (`classid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `yoyocmf_enewsinfotype`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_enewsinfotype`;
CREATE TABLE `yoyocmf_enewsinfotype` (
  `typeid` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT '分类ID',
  `classids` text NOT NULL COMMENT '所属栏目ID(多个栏目ID用“,”半角逗号隔开，例如：,1,2,3,)',
  `tname` varchar(30) NOT NULL DEFAULT '' COMMENT '分类名称',
  `myorder` smallint(6) NOT NULL DEFAULT '0' COMMENT '排序',
  `tnum` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '每页显示记录数',
  `tpath` varchar(100) NOT NULL DEFAULT '' COMMENT '存放文件夹',
  `ttype` varchar(10) NOT NULL DEFAULT '' COMMENT '文件扩展名',
  `maxnum` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '显示总记录数',
  `reorder` varchar(50) NOT NULL DEFAULT '' COMMENT '排序方式',
  `tbname` varchar(60) NOT NULL DEFAULT '' COMMENT '表名',
  `timg` varchar(200) NOT NULL DEFAULT '' COMMENT '分类缩略图',
  `intro` varchar(255) NOT NULL DEFAULT '' COMMENT '分类简介',
  `pagekey` varchar(255) NOT NULL DEFAULT '' COMMENT '网页关键字',
  PRIMARY KEY (`typeid`),
  KEY `myorder` (`myorder`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

