-- ----------------------------
--  Table structure for `yoyocmf_system_log`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_system_log`;
CREATE TABLE `yoyocmf_system_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `level` int(11) DEFAULT NULL COMMENT '级别',
  `category` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '分类',
  `log_time` double DEFAULT NULL COMMENT '日志时间',
  `prefix` text COLLATE utf8_unicode_ci COMMENT '错误路由',
  `message` text COLLATE utf8_unicode_ci COMMENT '错误内容',
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `level` (`level`)
) ENGINE=InnoDB AUTO_INCREMENT=3561 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

