-- ----------------------------
--  Table structure for `yoyocmf_user`
-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_user`;
CREATE TABLE `yoyocmf_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `auth_key` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `password_hash` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `password_reset_token` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `status` smallint(6) NOT NULL DEFAULT '10',
  `created_at` int(11) NOT NULL,
  `updated_at` int(11) NOT NULL,
  `group_id` smallint(5) DEFAULT NULL COMMENT '会员组ID',
  `user_fen` mediumint(8) DEFAULT NULL COMMENT '点数',
  `user_date` int(10) DEFAULT NULL COMMENT '有效期',
  `money` float(11,2) DEFAULT NULL COMMENT '金额',
  `z_group_id` smallint(5) DEFAULT NULL COMMENT '到期后转向会员组ID',
  `havemsg` tinyint(1) DEFAULT NULL COMMENT '是否有短信息,1为提示有短信息，0为不提示',
  `checked` tinyint(1) DEFAULT NULL COMMENT '是否审核,1为已审核，0为未审核',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `password_reset_token` (`password_reset_token`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

