-- ----------------------------
DROP TABLE IF EXISTS `yoyocmf_user_department`;
CREATE TABLE `yoyocmf_user_department` (
  `department_id` int(11) NOT NULL AUTO_INCREMENT,
  `parent` int(11) DEFAULT NULL COMMENT '父级',
  `department_name` varchar(128) NOT NULL DEFAULT '' COMMENT '部门名称',
  `myorder` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
  `level` int(11) DEFAULT NULL COMMENT '部门级别',
  PRIMARY KEY (`department_id`),
  KEY `department_id` (`department_id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8;

