  `level` smallint(6) NOT NULL DEFAULT '0' COMMENT '会员组级别值',
  `checked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '预定义字段，暂时用不到，默认值0',
  `fava_num` smallint(6) NOT NULL DEFAULT '0' COMMENT '最大收藏夹数',
  `day_down` int(11) NOT NULL DEFAULT '0' COMMENT '每天最大下载数',
  `msg_len` int(11) NOT NULL DEFAULT '0' COMMENT '短信息最大字数',
  `msg_num` int(11) NOT NULL DEFAULT '0' COMMENT '最大短信息数',
  `can_reg` tinyint(1) NOT NULL DEFAULT '0' COMMENT '会员组前台可注册，1为可注册，0为不可注册',
  `reg_checked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '注册需要审核，1为需要审核，0为不需要审核',
  `space_style_id` smallint(6) NOT NULL DEFAULT '0' COMMENT '默认空间模板ID',
  `day_add_info` smallint(6) NOT NULL DEFAULT '0' COMMENT '每天最大投稿数',
  `info_checked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '投稿信息是否审核，1为不需要审核，0为需要审核',
  `pl_checked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '评论是否审核，1为不需要审核，0为需要审核',
  PRIMARY KEY (`group_id`),
  KEY `group_id` (`group_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

