DROP TABLE IF EXISTS `yoyocmf_user_profile`;
CREATE TABLE `yoyocmf_user_profile` (
  `user_id` int(10) unsigned NOT NULL DEFAULT '0',
  `true_name` varchar(20) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '真实姓名',
  `oicq` varchar(25) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT 'QQ号码',
