  `phone` varchar(30) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '手机号码',
  `address` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '联系地址',
  `zip` varchar(8) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '邮编号码',
  `space_style_id` smallint(6) NOT NULL DEFAULT '0' COMMENT '会员空间模板ID',
  `homepage` varchar(200) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '个人主页',
  `say_text` text CHARACTER SET utf8 NOT NULL COMMENT '简介',
  `company` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '公司名称',
  `fax` varchar(30) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '传真号码',
  `user_pic` varchar(200) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '会员头像',
  `space_name` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '会员空间名称',
  `space_gg` text CHARACTER SET utf8 NOT NULL COMMENT '会员空间公告',
  `view_stats` int(11) NOT NULL DEFAULT '0' COMMENT '会员空间访问数量',
