  `reg_ip_port` varchar(6) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '注册IP端口号',
  `last_ip_port` varchar(6) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '最后一次登录IP端口号',
  `department_id` int(11) NOT NULL DEFAULT '0' COMMENT '部门ID',
  `job_id` int(11) NOT NULL DEFAULT '0' COMMENT '职位ID',
  PRIMARY KEY (`user_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

